import sys

def gcd(x,y):
    if y > x:
        x,y = y,x
    while y:
        x,y = y,(x%y)
    return x

def lcm(x , y):
    return x / gcd(x,y) * y

def gcd_extend(x,y):
    if y==0:
        u = 1
        v = 0
    else:
        s = x / y
        r = x % y
        (u0,v0) = gcd_extend(y,r)
        u = v0
        v = u0 - s * v0
    return (u,v)

